document.addEventListener("DOMContentLoaded",function(){let t=document.getElementsByClassName("tracker-count");for(let e=0;e<t.length;e++){let n=t[e],o=parseInt(n.getAttribute("width")),r=parseInt(n.getAttribute("height")),i=1e3*parseFloat(n.getAttribute("access"));function l(){let t=Math.floor(Math.random()*(r-o+1))+o;n.textContent=t}l(),setInterval(l,i)}});